Photographer's Guide to Photoshop 5th edition. With updated information to include the latest updates in Photoshop, this MagBook, created by photographers for photographers, is vital for anyone looking to master Photoshop's basic and advanced editing tools and features. 

After mastering the basics you'll benefit from the expert written step-by-step instructions across a variety of Photoshop artistic techniques, including creating x-ray images and graphic art effects, adding texture and creating captivating montages, guaranteed to help you turn your images into striking pieces of art! Learn how to work in Raw, understand layers, work in black and white, master curves and levels, add drama to dull images, restore old images and much more.

The Photographer's Guide to Photoshop - 5th edition, 2013
